VALUES ('20369927', 'Instant Thai Noodles Prawn Flavour', '85 % de nouilles instantanées : farine de _blé_, huile végétale (huile de palme, antioxydant : extraits riches en tocophérol), eau, sel, sucre, exhausteur de goût : glutamate monosodique ; colorant : caramel ordinaire. Mélange d\'assaisonnement : sel, arôme de crevettes, sucre, exhausteur de goût : glutamate monosodique ; colorant : caramel ordinaire ; huile végétale (huile de tournesol, antioxydant : extraits riches en tocophérol), exhausteurs de goût : guanylate disodique, inosinate disodique, antioagglomérant : dioxyde de silicium ; acidifiant : acide citrique ; colorant : extrait de paprika. Huile épicée : huile végétale (huile de tournesol, antioxydant : extraits riches en tocophérol), ail, colorant : extrait de paprika. Herbes aromatiques : ail déshydraté, ciboulette déshydratée. Piment en poudre piquant.', 'https://static.openfoodfacts.org/images/products/20369927/front_fr.8.400.jpg', '22.9', '12.3', '49', '2.9', '', '13.4', '7.33', '2.88582677165354', '', '0');

