VALUES ('20423230', 'bio organic', 'HU Ultramagas homérsékleten hökezelt, homogénezett sirszegény bio tej. Zsírtartalom: 1,5%. Ellenőrzött ökológiai gazdálkodásból származó termék. Bontatlan csomagolásban tárolva minöségét megörzi (nap/hónap/év): a csomagolás tetején feltüntetett idopontig. Száraz, hüvös helyen tárolandó! Felbontás után hütöszekrényben tároljuk és 3-4 napon belül fogyasszuk el! RO Lapte ecologic semidegresat. Produs omogenizat, ultra - pasteurizat. Continut de gräsime 1,5%. Ingrediente: lapte de vacă ultrapasteurizat. 1din agricultură ecologică controlată. A se pästra la loc uscat şi racoros. După deschiderea ambalajului, a se păstra la frigider şi a se consuma în decurs de maximum 4 zile. A se consuma de preefrintă inainte de/Nr.Lot: vezi partea superioară. Produs în UE pentru S.C. Lidl Discount SRL, Sat Nedelea, Comuna Ariceşti Rahtivani, DN 72, Crângul lui Bot, KM 73+810, județul Prahova, România. BG Биомляко за пиене, полуобезмаслено, 1,5% масленост, ХОмогенизирано, обработено с изключително висока температура - UHT. 1от контролирано биологично производство. Неотворен при - съхрӑнение до +25°С най-добър до:/Партида: виж горната част на опаковката. След отваряне сыхранявайте в хладилник и Консумирайте до 3-4 дни, но не по-кьсно от датата, обозначаваща срока на трайност. Производител: АФ Дойчланд Гмбҳ, Валерщрасе 2, 40472 Доселдорф, Германия. DE MV 006 EG C/PAP/ALU Gyátja:/Producator AF Deutschland GMBH, Wahlerstr. 2, D-40472 Düsseldorf, Germania', 'https://static.openfoodfacts.org/images/products/20423230/front_fr.12.400.jpg', '1.5', '1', '5.1', '5.1', '', '3.5', '0.13', '0.0511811023622047', '', '1');

