 ; sirop de glucose, sucre, agent d\'enrobage : shellac ; huile de coco, acidifiant : acide citrique]), 1% plaques de chocolat (sucre, pâte de cacao, beurre de cacao, _lait_ entier en poudre, lactose (_lait_) beurre concentré (_lait_), émulsifiant : lécithines (_soja_) ; arôme naturel de vanille). *d\'œufs plein air. 5 % Pépites de chocolat : cacao : 43% minimum. Chocolat blanc : beurre de cacao : 24% minimum ; matière sèche issue du lait : 24,7 % minimum. 1 % Morceaux de chocolat : cacao : 50% minimum.', 'https://static.openfoodfacts.org/images/products/20435820/front_fr.15.400.jpg', '13', '8.5', '24', '22', '', '4.8', '0.23', '0.0905511811023622', '', '0');

